import styled from 'styled-components';

function Backdrop({ ...props }) {
	const Backdrop = styled.div`
		background-color: white;
		height: 100vh;
		width: 100vw;
	`;

	const Button = styled.button``;

	return (
		<Backdrop>
			<Button>X</Button>
			{props.children}
		</Backdrop>
	);
}

export default Backdrop;
